import { Component, OnInit } from '@angular/core';
import { LeaderboardService } from '../leaderboard.service';
import 

@Component({
  selector: 'app-add-leaderboard-page',
  templateUrl: './add-leaderboard-page.component.html',
  styleUrls: ['./add-leaderboard-page.component.css']
})
export class AddLeaderboardPageComponent implements OnInit{
  constructor(
    private router: Router,
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
  }

  onSubmit({ firstName, lastName, gamertag, platform, age, regionID }: Player): void {
    alert(`Adding ${firstName} ${lastName}`);
    this.leaderboardService.createPlayer(firstName, lastName, gamertag, platform, age, regionID)
      .subscribe(() => {
        this.router.navigateByUrl('/q1');
      }); 
  }
}
